import React, { Component } from "react";

import { 
  MDBContainer,
  MDBNavbar, MDBNavbarBrand, MDBNavbarNav, MDBNavItem, MDBNavLink, MDBNavbarToggler, 
  MDBCollapse, 
  MDBFormInline, 
  MDBTabContent, MDBTabPane,
} from "mdbreact";

import competence from "./competence";
import formation from "./formation";
import contact from "./contact";
import experience from "./experience";

import picture from "../pictures/IMG_6767.JPG";
import "../index.css";

class NavbarPage extends Component {
state = {
    activeItem: "1"
}

toggle = tab => () => {
    if (this.state.activeItem !== tab) {
    this.setState({
    activeItem: tab
    });
    }
}

render() {
  return (
    <MDBContainer>
      <header>
        <MDBNavbar color="blue" dark expand="md" fixed="top">

          <MDBNavbarBrand>
              <img id="pic" src={picture} />
              <strong id="haut" className="white-text">MonCV</strong>
          </MDBNavbarBrand>

          <MDBNavbarToggler onClick={this.toggleCollapse} />

          <MDBCollapse id="navbarCollapse3" isOpen={this.state.isOpen} navbar>

            <MDBNavbarNav left>
              <MDBNavItem>
                  <MDBNavLink link to="#"
                active={this.state.activeItem === "1"}
                onClick={this.toggle("1")}
                role="tab">Contact</MDBNavLink>
              </MDBNavItem>
              <MDBNavItem>
                  <MDBNavLink to="#!">Compétences</MDBNavLink>
              </MDBNavItem>
              <MDBNavItem>
                  <MDBNavLink to="#!">Expériences</MDBNavLink>
              </MDBNavItem>
              <MDBNavItem>
                  <MDBNavLink to="#!">Formation</MDBNavLink>
              </MDBNavItem>
            </MDBNavbarNav>

            <MDBNavbarNav right>
              <MDBNavItem>
                <MDBFormInline waves>
                  <div className="md-form my-0">
                    <input className="form-control mr-sm-2" type="text" placeholder="Search" aria-label="Search" />
                  </div>
                </MDBFormInline>
              </MDBNavItem>
            </MDBNavbarNav>
          </MDBCollapse>
        </MDBNavbar>
      </header>

    <main>
      <MDBTabContent
          className="card"
          activeItem={this.state.activeItem}
        >
          <MDBTabPane tabId="1" role="tabpanel">
            <p className="mt-2">
              Raw denim you probably haven't heard of them jean shorts
              Austin. Nesciunt tofu stumptown aliqua, retro synth master
              cleanse. Mustache cliche tempor, williamsburg carles vegan
              helvetica. Reprehenderit butcher retro keffiyeh dreamcatcher
              synth. Cosby sweater eu banh mi, qui irure terry richardson
              ex squid. Aliquip placeat salvia cillum iphone. Seitan
              aliquip quis cardigan american apparel, butcher voluptate
              nisi qui.
            </p>
          </MDBTabPane>
        </MDBTabContent>
      </main>

    </MDBContainer>
    );
  }
}

export default NavbarPage;
